import s from './Orders.module.css';

const Orders = ({ orderArr, orderNum }) => {

let ans = 0;

  return (
    <>
      <div className={s.wrap}>

        {
          Object.entries(orderArr).map(([key, value]) =>
            <div className={s.card}>
              <p className={s.num}>â„– {key}</p>
              <p>{Object.entries(value).reduce((totalPrice, price) => totalPrice + value.price, 0)}</p>
              {Object.entries(value).map(([key, { name, price, process, image }]) =>
                <div className={s.info}>
                  <img src={image}></img>
                  <p>{name}</p>
                  <p>${price}</p>
                  <p>{process}</p>
                  <p>{ans+price}</p>
                </div>
              )}
            </div>
          )}
          </div>

    </>
  );
}

export default Orders;
